// THE GAME

Welcome to Age of Empires II HD - The Forgotten; the first new official expansion for the Age of Empires II universe in over ten years. Challenge friends with five additional civilizations and technologies, battle through four campaigns or vanquish opponents in new game modes on massive maps.


// SPECS

Windows game wrapped to run on MAC OS X. Tested with Mavericks.
Pre-cracked 'Reloaded' version, wrapped in a Wineskin app.
App icon made by me =]


// INSTALL

1. Open the .dmg
2. Drag'n'drop the game app and Wineskin in the Applications folder
3. Open Wineskin, press the (+) button, press 'Download and Install'. This is a prepacked Windows emulation suite, needed to run the game)
4. Play the game!

// DISCLAIMER

&quot;If you like the game, go buy it.&quot;
Yeah, right, if they ever release it natively for the Mac! :P
